import "./App.css";
import News from "./News/News";
import useFetch from "./useFetch";

function App() {
  const { data, loading, error } = useFetch(
    "http://hn.algolia.com/api/v1/search?query=test"
  );

  if (loading) {
    return <div>Loading</div>;
  }

  if (error) console.log(error);

  return (
    <>
      <div className="App">
        <div className="app-background">
        <nav className="top-nav navbar nav-expand navbar-dark bg-grey fixed-top">
          <div className="header">
            <div className="menu-bar">
            <nav class="navbar navbar-expand-lg navbar-light bg-light">
              <a class="navbar-brand" href="#">Navbar</a>
              <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span class="navbar-toggler-icon"></span>
              </button>
              <div class="collapse navbar-collapse" id="navbarNav">
                <ul class="navbar-nav">
                  <li class="nav-item active">
                    <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
                  </li>
                  <li class="nav-item">
                    <a class="nav-link" href="#">Features</a>
                  </li>
                  <li class="nav-item">
                    <a class="nav-link" href="#">Pricing</a>
                  </li>
                  <li class="nav-item">
                    <a class="nav-link disabled" href="#">Disabled</a>
                  </li>
                </ul>
              </div>
</nav>
            </div>
          </div>
        </nav>
        <h1 className="headlines mt-5 pt-5">TODAY'S HEADLINES</h1>
        <i class="bi bi-code-square red-text"/>
        <News data={data} />
        </div>
      </div>
    </>
  );
}

export default App;
